insert into project (backing_pct, last_update, last_updated_by, status, duration, creation_date, is_public, description, short_description, title, user_user_id) values(0, '2016-06-08', 'Team1', 'A', '133920', '2016-06-08', false, 'Wanneer er voorwerpen gevonden worden zou het handig zijn om deze te registreren op een webapplicatie en/of app.  Zo is er een centrale plaats waar studenten/docenten terecht kunnen om te zien of hun verloren voorwerp teruggevonden werd.  Achteraf bij het afhalen kan dan ook een registratie gebeuren op basis van de studentenkaart/identiteitskaart. Zo kan achteraf altijd nagegaan worden wie wat wanneer heeft afgehaald.', 'Ontwikkelen van een webapplicatie/app voor registratie van vergeten/verloren voorwerpen.', 'PXL Lost & Found', 11);
insert into project (backing_pct, last_update, last_updated_by, status, duration, creation_date, is_public, description, short_description, title, user_user_id) values(0, '2016-06-10', 'Team1', 'A', '133920', '2016-06-10', false, 'De laptopdienst van de PXL zou handig gebruik kunnen van een centrale opslagplaats voor informatie. Nu worden er linken bewaard naar oplossingen van bepaalde problemen maar die informatie kan potentieel verdwijnen. Ook de doorstroming van de informatie tussen de verschillende medewerkers is soms een probleem. Een applicatie waar i.p.v. de link, de informatie zelf wordt bijgehouden kan hier verandering in brengen.', 'De laptopdienst van de PXL zou handig gebruik kunnen van een centrale opslagplaats voor informatie.', 'Laptopdienst PXL - Centrale opslagplaats voor informatie', 12);
insert into project (backing_pct, last_update, last_updated_by, status, duration, creation_date, is_public, description, short_description, title, user_user_id) values(0, '2016-06-10', 'Team1', 'A', '133920', '2016-06-10', false, 'Een systeem om enkel de juiste personen te raadplegen wanneer er nieuwe studieboeken beschikbaar zijn. Op dit moment worden alle studenten verwittigd wanneer er een belangrijk studieboek binnen is gekomen dat slechts bestemd is de afdeling IT of bedrijfsmanagement. Dit heeft tot gevolg dat vele studenten hun emails niet meer lezen en zo belangrijk studiemateriaal mislopen! Daarom graag een oplossing om ervoor te zorgen dat alle studenten van een bepaalde studierichting en jaar verwittigd worden wanneer er voor hun specifiek een belangrijk studiedocument beschikbaar is. Dit programma kan aangevuld worden met een accurate prijslijst of stockbeheer, maar dat is niet noodzakelijk. Vroeger kon die via Blackboard maar deze optie is helaas verdwenen. We hadden graag zo snel mogelijk een oplossing!', 'Een programma om de juiste mensen te contacteren om hun boeken te komen afhalen.', 'Bookshop @ PXL notification center', 13);
